Wintercroft Dragon Head v2

&quot;These plans enable you turn simple recycled card into a stunning 3D Low Polygon Dragon Mask. Just print the templates on paper, stick them to card, cut them out, match the numbers and tape the parts together. The Mask is scaled to fit an adult but you can make children's masks by scaling down the templates when you print...The templates come with instructions for an internal head band that can be adjusted by moving the fixing points to get a snug fit.&quot;
&quot;The masks are ideal for festivals, parties and even weddings!&quot;
&quot;The finished masks are pretty robust due the their polygon construction so should survive the wildest of parties.&quot;

